import React from "react";
import { AppBar, Toolbar } from "@mui/material";
import './nav-bar.css';

const NavBar = () => {
    return (
        <AppBar className="app-bar">
            <Toolbar>
                <p>Code for interview </p>
                <p>All User</p>
                <p>Add user</p>
            </Toolbar>
        </AppBar>
    )
}

export default NavBar;
